onnel particulier</em><br><em>– De faciliter l’accès à un titre professionnel de “Développeur web et mobile”</em><br><em>– D’orienter les bénéficiaires vers un métier d’avenir</em></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Pour rappel, vous avez jusqu’au&nbsp;12 janvier 2020 pour remplir le formulaire de candidatures.</p>\n<!-- /wp:paragraph -->','Appel de formation','','publish','open','open','','appel-de-formation','','','2022-01-18 00:07:09','2022-01-18 00:07:09','',0,'http://localhost/wordpress/?p=172',0,'post','',1),(173,1,'2022-01-18 00:07:09','2022-01-18 00:07:09','<!-- wp:paragraph -->\n<p>Devenez un développeur web et mobile en seulement 9 mois avec La Fabrique Simplon. En partenaire avec l’<a href=\"https://www.auf.org/\">AUF</a>, le réseau de fabriques numériques et inclusives en France et à l’étranger lance un appel à candidatures pour le recrutement de sa troisième promotion.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Cette formation est née du partenariat avec la Société Générale et l’AUF (Agence Universitaire de la Francophonie)</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><em>Le but de cette formation est :</em><br><em>– De donner des compétences en Développement web et mobile</em><br><em>– De donner un accompagnement professionnel particulier</em><br><em>– De faciliter l’accès à un titre professionnel de “Développeur web et mobile”</em><br><em>– D’orienter les bénéficiaires vers un métier d’avenir</em></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Pour rappel, vous avez jusqu’au&nbsp;12 janvier 2020 pour remplir le formulaire de candidatures.</p>\n<!-- /wp:paragraph -->','Appel de formation','','inherit','closed','closed','','172-revision-v1','','','2022-01-18 00:07:09','2022-01-18 00:07:09','',172,'http://localhost/wordpress/?p=173',0,'revision','',0),(174,1,'2022-01-18 00:08:53','2022-01-18 00:08:53','{\n    \"sidebars_widgets[sidebar-1]\": {\n        \"value\": [],\n        \"type\": \"option\",